import React, { useState } from 'react';
import Textform from './Components/Textform';
import Navbar from './Components/Navbar';

function App() {
  const [mode, setMode] = useState('light');

  const toggleMode = () => {
    if (mode === 'light') {
      setMode('dark');
      document.body.style.backgroundColor = '#333'; // Change to the desired dark background color
    } else {
      setMode('light');
      document.body.style.backgroundColor = 'white'; // Change to the desired light background color
    }
    console.log(mode);
  };


  return (
    <>
      <Navbar title="Abdul Rafay" mode={mode} toggle={toggleMode} Search="NotNow" />
      <Textform mode={mode} />
    </>
  );
}

export default App;
